class LandingPage extends Component {



    render() {
        return (
            <React.Fragment>
                <div className="text-center">
                    <h3>Categorias m√°s populares</h3>
                     <PopularCategories/>
                </div>
              <Posts/>       
              <Categories/>

            </React.Fragment>
        );
    }
}


export default LandingPage;
